div.div:
Trailing return type - указание возвращаемого типа с использованием другого синтаксиса.
auto foo() -> int; // возвращаемый тип - int
Изначально trailing return type был введен в C++11 для вывода возвращаемого типа в зависимости от переданных аргументов (используя шаблонное метапрограммирование). Помимо этого, trailing return type - это единственный способ указания возвращаемого типа для лямбда функций.
Есть аргументы как за, так и против использования trailing return type. Прежде всего они касаются вкусовых предпочтений программиста. Однако, в групповых проектах, обычно принимают единый code style, которому следует все участники команды.
Причинами использовать trailing return type могут являться:
удобство в чтении (при соглашении что auto - как ключевое слово, обозначающее функцию, подобно func и другим аналогами в разных языках программирования), когда по одному внешнему виду можно мгновенно понять, что это функция, имя которой читается в начале (а обычно имя - ключевой элемент для понимания при чтении кода);
выравнивание - все имена функций выравнены по одному и тому же значению (длине слова auto);
Основной причиной не использовать trailing return type без необходимости:
подавляющее большинство кодовой базы C++ написано без trailing return type. В целях сохранения единообразия стиля со сторонними библиотеками и с юмещимся легаси, trailing return type не рекомендуется использовать;
